
import jsPDF from 'jspdf';

const ImagePdfGenerator = () => {
  const generateImagePDF = () => {
    const doc = new jsPDF();
    
    // Add title
    doc.setFontSize(18);
    doc.text("Document with Image", 105, 15, { align: "center" });
    
    // Add image
    // Note: Image must be base64 encoded
    const imgData = 'data:image/png;base64,';
    doc.addImage(imgData, 'JPEG', 15, 40, 180, 160);
    
    doc.save("with-image.pdf");
  };

  return (
    <button onClick={generateImagePDF}>
      Generate PDF with Image
    </button>
  );
};

export default ImagePdfGenerator;